script: |
  super -f text -I q3432.spq | sort > q3432.out

inputs:
  - name: q3432.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT ( NULL NOT BETWEEN - col1 AND + - col0 * col2 * + CAST ( + - 24 AS INTEGER ) * - 8 + + col0 );
  - name: tab0

outputs:
  - name: q3432.out
    data: |
